create table if not exists student (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	active_course INT,
	certificate_earned INT,
	course_enrolled INT,
	hours_watched INT,
	country VARCHAR(50),
	sex VARCHAR(50),
	date_of_birth DATE,
	schedules INT,
	email_address VARCHAR(50),
	profile_picture VARCHAR(50)
);
